import Slider from "react-slick";
import Head from 'next/head'
import img from '../roy.jpg'

function NextArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      className={className}
      style={{ ...style, display: "block", background: "white", borderradius : "50%" }}
      onClick={onClick}
    />

  );
}

function PrevArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      className={className}
      style={{...style, display: "block", background: "white", borderradius : "50%"}}
      onClick={onClick}
    />
  );
}
export default function Home() {

  const data = [
    {
      image: img,
      name: "Sid",
      degree: "lorem ipsum",
      subject: "something"
    },
    {
      image: img,
      name: "abid",
      degree: "lorem ipsum",
      subject: "something"
    },
    {
      image: img,
      name: "Sidsd",
      degree: "lorem ipsum",
      subject: "something"
    },
    {
      image: img,
      name: "Sid",
      degree: "lorem ipsum",
      subject: "something"
    },
    {
      image: img,
      name: "Sid",
      degree: "lorem ipsum",
      subject: "something"
    },
    {
      image: img,
      name: "Sid",
      degree: "lorem ipsum",
      subject: "something"
    } 
  ]

  const settings = {
    infinite: true,
    arrows: true,
    slidesToShow: 3,
    speed: 500,
    nextArrow: <NextArrow />,
    prevArrow: <PrevArrow />
  };
  return (
    <div className = "cont">
      <Head>
        <>
        <link rel="stylesheet" type="text/css" charSet="UTF-8" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css" />
        <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css" />
        <link rel="stylesheet" type="text/css" href="http://kenwheeler.github.io/slick/slick/slick-theme.css"/>
        </>
      </Head>
     <h3>Meet our Teachers</h3>
     <p style ={{paddingBottom: '80px'}}>Expert teachers from top universities will guide you in all your academic needs</p>
      <Slider {...settings}>
        {
          (data || []).map((ele, key) => {
            return (
              <div className="team-card">
                <img className = 'img' src={ele.image} />
                <h3>{ele.name}</h3>
                <h2>{ele.degree}</h2>
                <p>{ele.subject}</p>
              </div>
            )
          })
        }
      </Slider>

      <style jsx>{`
        .cont{
            text-align : center;
            padding: 50px 40px 40px 40px;
        }
        .img{
            width : 50%;
            height : 50%;
            display : inherit;
            border-radius : 50%;
        }
        .team-card{
          opacity : 0.7;
        }
        
      `}</style>

      <style jsx global>{`
        html,
        body {
          padding: 0;
          margin: 0;
          font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto,
            Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue,
            sans-serif;
        }

        * {
          box-sizing: border-box;
        }
        // .slick-current{
        //   opacity : 1 !important;
        // }
        .slick-prev:before, .slick-next:before{
            color: red;
        }
        .slick-slide {
          opacity:0;
          transition:opacity 1s ease-out;
        }
        
      .slick-active {
          opacity:1!important;
          transition:opacity 1s ease-in;
        }
        
      .slick-cloned {
        opacity: 0.3;
      }
      `}</style>
    </div>
  )
}
